$(function(){describe("RSS Feeds",function(){it("are defined",function(){expect(allFeeds).toBeDefined();expect(allFeeds.length).not.toBe(0)});it("should have a url for each feed",function(){for(var a=0;a<allFeeds.length;a++){expect(allFeeds[a].url).toBeDefined();expect(allFeeds[a].url).not.toBe("")}});it("should have a name for each feed",function(){for(var a=0;a<allFeeds.length;a++){expect(allFeeds[a].name).toBeDefined();expect(allFeeds[a].name).not.toBe("")}})});describe("The Menu",function(){it("should be hidden by default",function(){expect($("body").hasClass("menu-hidden")).toBe(true)});it("should show when menu button is clicked and hide when clicked again",function(){$(".menu-icon-link").trigger("click");expect($("body").hasClass("menu-hidden")).toBe(false);$(".menu-icon-link").trigger("click");expect($("body").hasClass("menu-hidden")).toBe(true)});it("should have a menu item for each item in the allFeeds array",function(){expect($(".feed-list li").length).toBe(allFeeds.length)})});describe("Initial Entries",function(){beforeEach(function(a){loadFeed(0,a)});it("should have at least a single entry element within the .feed container",function(){var a=$(".feed .entry");expect(a.length).toBeGreaterThan(0)})});describe("New Feed Selection",function(){var b,a;beforeEach(function(c){loadFeed(1,function(){a=$(".feed .entry");loadFeed(0,function(){b=$(".feed .entry");c()})})});it("should change the content for the subsequent feeds",function(){expect(a[0].innerText).not.toEqual(b[0].innerText)});it("should use different content for entries in the same feed",function(){expect(b[0].innerText).not.toEqual(b[1].innerText)})})}());